    <title>Reg Report</title>
    <style>
        body {
            margin: 0 !important;
            -webkit-print-color-adjust: exact;
        }
        .header {
            width: 95%;
            margin-top: 0px !important;
            padding-top: 0px;
        }

        .header-table {
            width: 100%;
            margin-right: 3rem !important;
            margin-left: 3rem;
            margin-top: 3px !important;
            margin-bottom: 0 !important;
            padding-left: 17rem;
		    padding-right: 15rem;
        }
        .header-table tr {
            margin-top: 0px !important;
            padding-top: 0px;
            margin-bottom: 0 !important;
   	    }

        .header-table td {
            vertical-align: top !important;
    	}

        .header-table td:nth-child(1) {
            width: 25%;
            padding-left: 35px;
            padding-top: 0px;
        }

        .header-table td:nth-child(2) {
            width: 75%;
            padding-right: 4px; 
            padding-top: 30px; /* 24 */
        }

        .separator {
            border-bottom: 2px solid #000000;
            width: 94%;
            margin-left: 34px !important;
            margin-top: 12px !important; /* 16 */
            margin-right: 0px !important;
            margin-bottom: 0 !important; /* 0 */
        }

        .report-type {
            font-family: 'Calibri' !important;
            color: #000000;
            font-size: 11pt !important;
            font-weight: bold;
            text-align: right;
        }

        .report-type-desc {
            font-family: 'Calibri' !important;
            color: #000000;
            font-size: 8pt !important;
            text-align: right;
        }

        .header-column-logo {
            display: inline-block;
            vertical-align: top;
            text-align: center;
            width: 73px; /* 100px */
            height: 66px; /* 90px */
        }

        .header-column-logo img {
            width: 100%;
            height: 100%;
        }

        .reg-info {
            margin-right: 1px !important;
        }

    </style>
